import React from 'react';
import ReactDOM from 'react-dom';
import logo from './synchit-logo.png';
import Calendar from 'react-calendar';

const App = () => {
  return (
    <div>
      <h1>
        SynchIT
      </h1>
      <p>
      ReactDOM.render(<Calendar />, document.getElementById('root'))
      </p>
    </div>
  );
}

export default App;
